import React, { useEffect } from 'react'
import { motion } from "framer-motion"

export default function Settings() {
    
  return (
    <motion.Box initial={{opacity}} sx={{bgcolor: "#121212"}} className='w-full h-screen absolute top-0 left-0'>
        salom
    </motion.Box>
  )
}
